const App = ()=>{

    return (
        <>

<Routes>
        <Route exact path='/' element={<About/>} />
        <Route path='/contact' element={<Contact/>} />
        <Route path="" element={<Error/>} />
        
 </Routes>



        {/* <About/>
        <Contact/> */}
        </>
    )
}

export default App;
